pattern = ""
complement = [""] * len(pattern)
reverse = [""] * len(pattern)

for i in range(len(pattern)):
    if pattern[i] == "A":
        complement[i] = "T"
    elif pattern[i] == "T":
        complement[i] = "A"
    elif pattern[i] == "C":
        complement[i] = "G"
    elif pattern[i] == "G":
        complement[i] = "C"

for i in range(len(pattern)):
    reverse[i] = complement[len(pattern) - i - 1]

print("".join(reverse))

